import React ,{Component} from 'react';
import './App.css';
import logo from "./image/postman.png";
import Sidebar from "./Sidebar";
class Dahboard extends Component {
    state = {  }
    render() { 
        return ( 
            <main>
            <img style={{marginLeft:"25rem"}} id="logo" src={logo} alt="postman-logo"/>
            <section className="main-content">
            <Sidebar />

            </section>
            
            </main>
            
         );
    }
}
 
export default Dahboard;
